import React from 'react'
import {Link} from 'react-router-dom'
import '/.App.css'

class NavBar extends React.Component {

   render(){
      return (
         <nav className="nav-bar">
            <ul>
               <Link to="/">
                  <li>Home</li>
               </Link>
               <Link to="/shop">
                  <li>Shop</li>
               </Link>
            </ul>
         </nav>
      )
   }
}

export default NavBar
